-- ----------------------------
-- Table structure for RankInfo
-- ----------------------------
DROP TABLE IF EXISTS `RankInfo`;
CREATE TABLE `RankInfo`  (
  `NO` int(11) NOT NULL COMMENT '标识字段',
  `PlatformID` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '平台ID(steamID64)',
  `RankID` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '查分ID(steamID3)',
  `TmdID` int(11) NULL DEFAULT NULL COMMENT '社区ID',
  `PersonaName` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '游戏昵称',
  `AvatarS` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '小头像',
  `AvatarM` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '中头像',
  `AvatarL` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '大头像',
  `State` int(11) NOT NULL COMMENT '0离线, 1在线, 2忙碌, 3离开, 4打盹, 5 想交易, 6想玩游戏',
  `GameID` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '游戏appID(SR: 207140)',
  `RankType` int(11) NOT NULL COMMENT '参与状态;;0无游戏,1上榜,2不上榜，3资料隐私',
  `RankCount` int(11) NULL DEFAULT NULL COMMENT '排位局数量',
  `RankLevel` int(11) NULL DEFAULT NULL COMMENT '段位：0新手；1入门；2进阶；3专家；4青铜；5白银；6黄金；7铂金；8钻石；9King',
  `RankScore` decimal(18, 3) NULL DEFAULT NULL COMMENT '天梯分',
  `OldRankScore` decimal(18, 3) NULL DEFAULT NULL COMMENT '昨天天梯分',
  `CreateTime` datetime NULL DEFAULT NULL,
  `ModifyTime` datetime NULL DEFAULT NULL,
  `WeekPlayTime` int(11) NOT NULL,
  `Participate` int(11) NULL DEFAULT NULL,
  `PlayTime` int(11) NULL DEFAULT NULL,
  PRIMARY KEY (`NO`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of RankInfo
-- ----------------------------

