DROP TABLE IF EXISTS `Sponsor`;
CREATE TABLE `Sponsor`  (
  `Name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `Amount` int(11) NULL DEFAULT NULL,
  `MatchNo` int(11) NULL DEFAULT NULL COMMENT '比赛编号',
  `SpeRule` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '特殊规则',
  INDEX `MatchNo`(`MatchNo`) USING BTREE
