DROP TABLE IF EXISTS `User`;
CREATE TABLE `User`  (
  `TmdID` int(11) NOT NULL COMMENT '社区ID',
  `Platform` int(11) NOT NULL COMMENT '平台(0steam,1wegame)',
  `PlatformID` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '平台ID(steamID64)',
  `Friends` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '有SR的好友列表(steamID64)',
  `CreateTime` datetime NULL DEFAULT NULL,
